  fullName: SuperOffice.Threading.ParallelConsumerQueue<T>
  type: Class
  assemblies:
  - SoCore
  namespace: SuperOffice.Threading
  summary: >-
    A simple, threadsafe/blocking implementation of Queue for ordinary operations. Note: please <b>read the remarks</b> to understand

    the differences between this class and the ordinary System.Collections.Generic.Queue class.

    Also contains methods to easily have multiple, identical consumer threads.
  remarks: >-
    This class has slightly different behaviour, as follows:

    <ul><li>Enqueue, Dequeue and Count are thread-safe</li><li>If the queue is empty, Dequeue will <b>block</b> instead of throwing an exception</li><li>If the queue is "full" (maxCapacity specified in constructor has been reached), then Enqueue will block</li><li>Peek <b>will</b> throw an exception if called while the queue is empty</li><li>Enumeration, and thus all kinds of LINQ operations, are <b>not</b> threadsafe</li></ul>

    The purpose of this class is to be used in a producer/consumer scenario, where the producer thread adds to the queue

    while the consumer thread feeds off the queue. The producer thread should block if the queue becomes too large,

    while the consumer thread should block until work becomes available.

    <p></p>

    There is no explicit method to signal "end-of-processing" to the consumer, but pushing NULL on the

    queue as an end marker is a simple way to do it - generally valid queue items will not be null.

    <p></p>

    The <xref href="SuperOffice.Threading.ParallelConsumerQueue%601.StartConsumers(System.Int32%2cSystem.Action%7b%600%7d)" data-throw-if-not-resolved="false"></xref> and <xref href="SuperOffice.Threading.ParallelConsumerQueue%601.StopConsumers" data-throw-if-not-resolved="false"></xref> methods are used if you have a consumer method to be run in its own thread,

    and you want one or more such to be easily started and stopped.
