  summary: >-
    Start <b>n</b> simultaneous consumer threads, each running the same code. The consumer methods have to take a single

    parameter, a queue item, and are called whenever there is something on the queue (items are <xref href="SuperOffice.Threading.ParallelConsumerQueue%601.Dequeue" data-throw-if-not-resolved="false"></xref>'d

    and the consumer method invoked once per item). null items cannot be used as they signal end-of-work on the queue
