  nameWithType: ParallelConsumerQueue<T>.Consume(int, Action<T>)
  fullName: SuperOffice.Threading.ParallelConsumerQueue<T>.Consume(int, System.Action<T>)
  type: Method
  assemblies:
  - SoCore
  namespace: SuperOffice.Threading
  summary: Factory method for a context object, suitable for <b>using</b> syntax
  remarks: >-
    An alternative to manually calling <xref href="SuperOffice.Threading.ParallelConsumerQueue%601.StartConsumers(System.Int32%2cSystem.Action%7b%600%7d)" data-throw-if-not-resolved="false"></xref> and <xref href="SuperOffice.Threading.ParallelConsumerQueue%601.StopConsumers" data-throw-if-not-resolved="false"></xref> is to use this method

    to obtain a disposable context class. Entering the using clause starts the consumers, and exiting it will cause the

    main thread to block until all the work items in the queue have been consumed; end marks are pushed and the consumer 

    threads terminate. The main thread will the continue past the end of the using scope.

    <example>

    This example is simplified for brevity. It shows how a queue with a limited capacity is set up,

    how a variable number of parallel threads to process items are started, and how the consumer

    method is created. Note the absence of calls to Dequeue, and no explicit thread management.

    <pre><code class="lang-csharp">ParallelConsumerQueue&gt;BulkImportInfo&lt; queue = new ParallelConsumerQueue&gt;BulkImportInfo&lt;(5);

    // start the consumer threads, and then iterate over incoming data, queuing up batches

    using (queue.Consume(NumShipoutThreads, WriteBulkRows))

    {
    	// pull data from the enumerable
    	DataTable batchBuffer = null;
    	foreach (object[] row in rows)
    	{
    		...
    		// if the batch is full, then ship it via the queue (blocks if the queue is "full")
    		if (rowsInBatch == ShipoutBatchSize)
    		{
    			queue.Enqueue(new BulkImportInfo() { Data = batchBuffer, Table = table });
    			rowsInBatch = 0;
    		}
    	}
    }

    ...

    protected override void WriteBulkRows(BulkImportInfo importInfo)

    {
    	using (SqlBulkCopy bcp = new SqlBulkCopy(rawConn))
    	{
    		bcp.DestinationTableName = SoDatabase.GetCurrent().TablePrefix + "." + importInfo.Table.DbName;
    		bcp.WriteToServer(importInfo.Data);
    	}
    }</code></pre>

    </example>
